-- ----------------------------
-- Event structure for cleanup_agent_heartbeats
-- ----------------------------
DROP EVENT IF EXISTS `cleanup_agent_heartbeats`;
delimiter ;;
CREATE EVENT `cleanup_agent_heartbeats`
ON SCHEDULE
EVERY '1' HOUR STARTS '2025-12-19 02:39:23'
DO DELETE FROM agent_heartbeats 
  WHERE heartbeat_timestamp < DATE_SUB(NOW(), INTERVAL 24 HOUR)
;;
delimiter ;

-- ----------------------------
-- Event structure for cleanup_agent_log_batches
-- ----------------------------
DROP EVENT IF EXISTS `cleanup_agent_log_batches`;
delimiter ;;
CREATE EVENT `cleanup_agent_log_batches`
ON SCHEDULE
EVERY '1' HOUR STARTS '2025-12-19 02:39:23'
DO DELETE FROM agent_log_batches 
  WHERE created_at < DATE_SUB(NOW(), INTERVAL 7 DAY)
;;
delimiter ;

SET FOREIGN_KEY_CHECKS = 1;
