INSERT INTO `blocking_rules` VALUES (1, 'Brute Force Protection', 'brute_force', 'block', 1, 1, 90, '{\"failed_attempts\": 5, \"unique_usernames\": 3, \"time_window_minutes\": 10}', 1440, 1, 1, NULL, 8, '2025-12-18 11:26:28', 8, 'Block IPs with 5+ failed attempts in 10 minutes across 3+ usernames', NULL, '2025-12-05 01:23:03', '2025-12-18 11:26:28');
INSERT INTO `blocking_rules` VALUES (2, 'High ML Risk Score', 'ml_threshold', 'block', 1, 1, 80, '{\"min_confidence\": 0.8, \"min_risk_score\": 85}', 1440, 1, 1, NULL, 7, '2025-12-20 20:56:56', 7, 'Block IPs with ML risk score >= 85 and confidence >= 80%', NULL, '2025-12-05 01:23:03', '2025-12-20 20:56:56');
