INSERT INTO `blocking_rules` VALUES (35, 'account_takeover_detection', 'account_takeover', 'block', 1, 1, 125, '{\"check_threat_intel\": true, \"time_window_minutes\": 30, \"unique_ips_threshold\": 3, \"unique_countries_threshold\": 2}', 1440, 1, 1, NULL, 10, '2025-12-20 09:21:51', 10, 'Detects when a username is targeted from multiple IPs/countries in a short time - indicates credential testing or compromised credentials.', NULL, '2025-12-19 23:59:33', '2025-12-20 09:21:51');
